import React, { useEffect, useState } from 'react';
import axios from 'axios';

const WinnerDisplay = () => {
  const [winners, setWinners] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch winner history from API
    axios.get('http://127.0.0.1:8000/api/restaurants/history/', {
      headers: { Authorization: `Bearer ${localStorage.getItem('access_token')}` }
    })
      .then(response => {
        setWinners(response.data);
      })
      .catch(err => {
        setError('Error fetching winner history');
        console.error('Error fetching winner history', err);
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      <h1>Winners List</h1>
      {winners.length > 0 ? (
        <ul>
          {winners.map((entry, index) => (
            <li key={index}>
              <strong>Date:</strong> {entry.date} <br />
              <strong>Winner:</strong> {entry.winner.name}
            </li>
          ))}
        </ul>
      ) : (
        <div>No winners yet</div>
      )}
    </div>
  );
};

export default WinnerDisplay;
